import 'bootstrap/dist/css/bootstrap.min.css';
import { Form, Button, Container } from "react-bootstrap";
import './App.css';

function App() {
  return (
    <div className="App">
      <Container>
        <Form>
          <Form.Group className="mb-3" controlId="formBasicText">
            <Form.Label>Text to analyze</Form.Label>
            <Form.Control as="textarea" placeholder="Enter text" rows="5" />
          </Form.Group>
          <Form.Group className="mb-3" controlId="formBasicRange">
            <Form.Label>How many keywords?</Form.Label>
            <Form.Range min={0} max={5} />
          </Form.Group>
          <Button variant="primary" type="submit">
            Submit
          </Button>
        </Form>
      </Container>
    </div >
  );
}

export default App;
